import React from 'react';
import Button from '../../../General/Button/button.js'
import './contest.css'

class Contest extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    if(!this.props.data){
      return("ooops")
    };
    return (
      <div className="contest mt-4">
        <h2 className="text-center mt-2 shadow py-2">Dont Miss Your Chance To Be A Winner</h2>
        <div className="contestBody">
          <h3 className={this.props.data.title.classN}> {this.props.data.title.title}</h3>
          <img className={this.props.data.img.classN} src={this.props.data.img.src} alt={this.props.data.img.variant}/>
          <div className="contestCinditions mx-2">
            <h4 className="condTitle mb-2"><b>{this.props.data.CondTitle}</b></h4>
            <p>{this.props.data.CondDescrip}</p>
          </div>
          <div className="contestAwards mx-2">
          <h4 className="awardsTitle mx-2 mb-2"><b>{this.props.data.AwardTitle}</b></h4>
            <ul>
              {this.props.data.AwardDescrip.map(item =>
                <li>{item}</li>
               )
              }
            </ul>
          </div>
        </div>
      </div>
    );
  }
}
export default Contest;
